import axios from "axios";
import { Link } from "react-router-dom";
const Tv = () => {
    async function getData() {
        const response =
            await axios.get(`https://api.themoviedb.org/3/tv/1138?api_key=692ad17fefe3f279a5bc0dfa87752845&language=en-US
        `);
        console.log(response);
    }
    getData();

    return <div></div>;
};

export default Tv;
